import './styles.css';
import { useEffect, useState } from 'react';
import axios from 'axios';

export default function App() {
  const [name, setName] = useState();
  useEffect(() => {
    console.log('name', name);
  });
  return (
    <form>
      <label>
        Enter your name:
        <input type="text" value={name} onChange={(e) => setName(e.target.value)} />
      </label>
    </form>
  );
}
